                "Segment": "Optische Engstellen wo z.B. Häuser näher an den Gehsteig gerückt sind, wären besser z.B. hilft das Haus Geyrstraße 57 wesentlich mehr als ein Bodenschwelle, da es sich förmlich über die Straße beugt. Auch wäre ein einfacher, weniger ornamentierter Bodenbelag, besser, da er weniger schnell zerstört wird. Ein Gefahrenmoment gibt es an der Kreuzung PWS\/Wiesengasse. dort müsste man meiner Meinung nach vor allem westwärts einen Mehrzweckstreifen beginnend westlich der PWS 9 bis zum Friedhof rüber markieren. Wenn man dort nämlich als Radler geradeausfahren möchte, kann man nur durch das Straßenbahngeleis nur schwer mittig fahren und wird dann beim Gradeausfahren in die Kreuzung von Rechtsabiegern überholt. Ich behelfe mich derzeit so, dass ich beim Geradeausfahren ein Linksabbiegezeichen gebe. Ist zwar mangels zwei Fahrspuren falsch aber hilft. Im Übrigen würde die Markierung des Mehrzweckstreifens klarstellen, dass man, wie derzeit üblich, die Straßenbahn in der Haltstelle nicht rechts überholen kann - das geht sich mangels Breite schon jetzt kaum aus und führt zu manchen gefährlichen Situationen für die Tram.",
