                "Code": "Probleme und Verbesserungsvorschläge (Kommentare)\\Verbesserrungvorschläge\\Infrastruktur\/Verkehr (konkret)",
                "Segment": "Genauso problematisch ist die Einbahnstraße von der Olympiabrücke in die Graßmayrstraße. Dort gibt es ebenfalls keinen Fahrradweg und die einzigen Möglichkeiten sind entweder \"Genauso problematisch ist die Einbahnstraße von der Olympiabrücke in die Graßmayrstraße. Dort gibt es ebenfalls keinen Fahrradweg und die einzigen Möglichkeiten sind entweder \"illegal\"Genauso problematisch ist die Einbahnstraße von der Olympiabrücke in die Graßmayrstraße. Dort gibt es ebenfalls keinen Fahrradweg und die einzigen Möglichkeiten sind entweder \"\"illegal\" durch die Einbahnstraße zu fahren (was die allermeisten Fahrradfahrenden machen), über den Fußgängerweg zu fahren, um den Block zu fahren oder das Fahrrad bis zur Hauptkreuzung zu schieben. Da ich in dieser Straße wohne und dieses Wegstück mehrmals täglich fahre, ist dies aber mit einem hohen Zeitaufwand verbunden und da die Polizei dort des Öfteren steht, auch immer wieder mit Geldstrafen, wenn man erwischt wird. -> Zitat von der Polizei: \"Genauso problematisch ist die Einbahnstraße von der Olympiabrücke in die Graßmayrstraße. Dort gibt es ebenfalls keinen Fahrradweg und die einzigen Möglichkeiten sind entweder \"\"illegal\"\" durch die Einbahnstraße zu fahren (was die allermeisten Fahrradfahrenden machen), über den Fußgängerweg zu fahren, um den Block zu fahren oder das Fahrrad bis zur Hauptkreuzung zu schieben. Da ich in dieser Straße wohne und dieses Wegstück mehrmals täglich fahre, ist dies aber mit einem hohen Zeitaufwand verbunden und da die Polizei dort des Öfteren steht, auch immer wieder mit Geldstrafen, wenn man erwischt wird. -> Zitat von der Polizei: \"Es gibt eh viel zu viele Fahrradfahrer.\"Genauso problematisch ist die Einbahnstraße von der Olympiabrücke in die Graßmayrstraße. Dort gibt es ebenfalls keinen Fahrradweg und die einzigen Möglichkeiten sind entweder \"\"illegal\"\" durch die Einbahnstraße zu fahren (was die allermeisten Fahrradfahrenden machen), über den Fußgängerweg zu fahren, um den Block zu fahren oder das Fahrrad bis zur Hauptkreuzung zu schieben. Da ich in dieser Straße wohne und dieses Wegstück mehrmals täglich fahre, ist dies aber mit einem hohen Zeitaufwand verbunden und da die Polizei dort des Öfteren steht, auch immer wieder mit Geldstrafen, wenn man erwischt wird. -> Zitat von der Polizei: \"\"Es gibt eh viel zu viele Fahrradfahrer.\" Wirklich gut fand ich den Ausbau eines Fahrradweges in der Tschamlerstraße. Dort wurden davor auch immer wieder Fahrradfahrende von der Polizei angehalten, es war aber immer noch besser, als von der Leopoldstraße nach links auf die Kaiserschützenplatzstraße abzubiegen, da man dort auch ständig von Autos und Bussen übersehen wurde. Insgesamt muss ich als Fahrradfahrer in Wilten immer noch sehr häufig auf Fußgängerwege ausweichen und mir zum Teil eigene Routen zusammenschustern (vor allem um die 174 herum) und die Ermahnungen von der Polizei und Beschwerden von Fußgängern akzeptieren (auch wenn ich dort immer sehr langsam werde, sobald ich an Menschen vorbeifahre) , da die Fahrradwege oft einfach aufhören oder es keinen Fahrradweg gibt und es auf der Straße für mich, vor allem wenn es dunkel ist aber einfach zu kritisch ist, da man doch sehr oft einfach übersehen wird. Leider werden die Fahrräder auch ständig gestohlen.",
